INSERT INTO `step_of_food` (`step_of_food_id`, `food_id`, `order`, `step`, `admin_id`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'ตั้งหม้อต้มซุป ใส่คนอร์ซุปเนื้อก้อน ต้มจนเดือดสักครู่ปิดไฟยกลง', 1, '2021-08-15 16:20:42', '2021-08-15 16:20:42'),
(2, 1, 2, 'หั่นเนื้อเป็นชิ้นเต๋าขนาด 1x1 นิ้ว หมักเนื้อด้วยกระเทียมทุบพอให้มีกลิ่นหอม ลูกผักชี พริกไทยเม็ดตำพอเเหลก หมักใส่ซอส ซีอิ๊วดำ ซีอิ๊วหวาน พริกไทยเกลือ คลุกเคล้าขยำให้เครื่องปรุงเข้าเนื้อ', 1, '2021-08-15 16:20:47', '2021-08-15 16:20:47'),
(3, 1, 3, 'ตั้งหม้อใส่น้ำมันเล็กน้อย ใส่เนื้อหมักลงไปในกระทะ นำน้ำซุปที่เตรียมไว้ล้างเครื่องซอสในภาชนะหมัก เทลงในหม้อที่อบ', 1, '2021-08-15 16:20:58', '2021-08-15 16:20:58'),
(4, 1, 4, 'ปอกเเครอท หั่นเป็นชิ้นยาวพอดีคำ ใส่ในหม้ออบ อบจนน้ำงวด และซึมเข้าไปในเนื้อ', 1, '2021-08-15 16:21:06', '2021-08-15 16:21:06'),
(5, 1, 5, 'ตั้งกระทะ ใส่เนย เจียวกระเทียม ข้าวสวยหุงสุก ปรุงรสด้วยคนอร์ผงอร่อยชัวร์ชิมรสตามใจชอบ', 1, '2021-08-15 16:21:17', '2021-08-15 16:21:17'),
(6, 1, 6, 'ตักข้าวผัด จัดวางเนื้ออบและผักให้สวยงามพร้อมเสิร์ฟ', 1, '2021-08-15 16:21:21', '2021-08-15 16:21:21'),
(7, 2, 1, 'ตั้งหม้อต้มน้ำบนไฟกลาง พอเดือดใส่เนื้อวัวลงไปต้มจนเดือดอีกครั้งใส่ข่า ตะไคร้ หอมแดง ลดเป็นไฟอ่อนแล้วคอยช้อนฟองและมันออกบ้างน้ำซุปจะได้ใส เคี่ยวนานประมาณ 45 นาที ถึง 1 ชั่วโมง', 1, '2021-08-15 17:32:43', '2021-08-15 17:32:43'),
(8, 2, 2, 'เติมคนอร์ซุปก้อนต้มยำคนให้ละลายต้มต่อสักครู่จนเปื่อยนุ่ม ใส่ใบมะกรูดลงในหม้อต้มต่อสักครู่ ด้วยไฟอ่อนสัก 2-3 นาที', 1, '2021-08-15 17:32:50', '2021-08-15 17:32:50'),
(9, 2, 3, 'เติมข้าวคั่ว โรยต้นหอมซอย ผักชีฝรั่ง และใบโหระพา ปิดไฟตักใส่ถ้วยโรยด้วยพริกขี้หนูบุปพร้อมเสิร์ฟ', 1, '2021-08-15 17:32:57', '2021-08-15 17:32:57'),
(10, 4, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่กระเทียมลงผัดพอมีกลิ่นหอม ใส่เนื้อลงผัดพอสุก ใส่เนื้อลงผัดพอสุก', 1, '2021-08-16 08:36:32', '2021-08-16 08:36:32'),
(11, 4, 2, 'ใส่หอมหัวใหญ่ พริกหวานทั้ง 3 สี', 1, '2021-08-16 08:36:38', '2021-08-16 08:36:38'),
(12, 4, 3, 'ปรุงรสด้วยซอสเห็ดหอม ซีอิ๊วขาว ซอสปรุงรส น้ำตาลทราย พริกไทยดำ เติมน้ำเปล่า และเหล้าจีน ผัดให้เข้ากัน ใส่ถั่วงอกผัดพอสุก ตักใส่ภาชนะ จัดเสิร์ฟ', 1, '2021-08-16 08:36:45', '2021-08-16 08:36:45'),
(13, 6, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่น้ำพริกแกงมัสมั่นลงผัดพอหอม เติมหัวกะทิผัดพอแตก มันใส่เนื้อสันคอหมูผัดพอสุก', 1, '2021-08-18 16:54:28', '2021-08-18 16:54:28'),
(14, 6, 2, 'เติมกะทิเข้มข้นปานกลางรอให้เดือด ใส่มันฝรั่ง หอมหัวใหญ่ ถั่วแดง ถั่วขาว เม็ดมะม่วงหิมพานต์ ใบกระวาน และ\r\nลูกกระวาน ต้มพอมันฝรั่งสุก', 1, '2021-08-18 16:54:34', '2021-08-18 16:54:34'),
(15, 6, 3, 'ปรุงรสด้วยน้ำปลา น้ำตาลปี๊บ น้ำมะขามเปียก เคี่ยวต่อจนส่วนผสมได้ที่ ตักใส่ภาชนะ จัดเสิร์ฟ', 1, '2021-08-18 16:54:41', '2021-08-18 16:54:41'),
(16, 7, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน นำ ปลากะพง ซีพี ลงทอดพอสุกเหลือง ตักขึ้นพักไว้', 2, '2021-08-18 17:03:38', '2021-08-18 17:03:38'),
(17, 7, 2, 'ผสมน้ำมะนาว น้ำปลา น้ำตาลทราย พริกขี้หนู น้ำพริกเผา คนพอเข้ากัน', 2, '2021-08-18 17:03:48', '2021-08-18 17:03:48'),
(18, 7, 3, 'ใส่ตะไคร้ซอย หอมแดง กระเทียม ขิง มะม่วงเปรี้ยว มะนาวหั่นชิ้น เม็ดมะม่วงหิมพานต์ ใบมะกรูด คลุกเคล้าพอเข้ากัน', 2, '2021-08-18 17:03:57', '2021-08-18 17:03:57'),
