INSERT INTO `step_of_food` (`step_of_food_id`, `food_id`, `order`, `step`, `admin_id`, `created_at`, `updated_at`) VALUES
(353, 107, 4, 'ใส่พริกไทยอ่อน ใบมะกรูด ปรุงรสด้วยน้ำปลา ซีอิ๊วขาว น้ำตาลทราย ซอสเห็ดหอม เติมน้ำเปล่า ผัดพอเข้ากัน', 3, '2021-09-15 12:04:37', '2021-09-15 12:04:37'),
(354, 107, 5, 'ใส่พริกชี้ฟ้าทั้ง 2 สี ผัดพอเข้ากันอีกครั้ง ตักใส่ภาชนะ จัดเสิร์ฟ', 3, '2021-09-15 12:04:43', '2021-09-15 12:04:43'),
(355, 108, 1, 'ผสมแป้งทอดกรอบและน้ำเย็นจัดคนให้เข้ากันจนมีลักษณะข้น นำสะโพกไก่ลงชุบน้ำแป้ง ใส่ลงทอดในน้ำมันพืชร้อนไฟปานกลางจนสุกเหลืองกรอบ ตักขึ้นพักไว้', 3, '2021-09-15 12:10:36', '2021-09-15 12:10:36'),
(356, 108, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่กระเทียมลงผัดพอหอม ใส่พริกหวาน แตงกวาญี่ปุ่น มะเขือเทศ และสับปะรดลงผัดพอสุก', 3, '2021-09-15 12:10:43', '2021-09-15 12:10:43'),
(357, 108, 3, 'ปรุงรสด้วยซอสมะเขือเทศ ซอสเห็ดหอม น้ำตาลทราย ซีอิ๊วขาว และซอสปรุงรส เติมน้ำเปล่าผัดให้เข้ากัน ใส่ไก่ทอดและต้นหอมหั่นท่อนผัดให้เข้ากันอีกครั้ง ตักใส่ภาชนะ จัดเสิร์ฟ', 3, '2021-09-15 12:10:48', '2021-09-15 12:10:48'),
(358, 110, 1, 'คลุกเนื้อปลานิลกับแป้งสาลีพอทั่ว นำลงทอดในน้ำมันพืชร้อนไฟปานกลางพอสุกเหลือง ตักขึ้นพักไว้ให้สะเด็ดน้ำมัน', 3, '2021-09-15 12:20:00', '2021-09-15 12:20:00'),
(359, 110, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน นำกระเทียมสับลงผัดพอเหลืองหอม ใส่หอมหัวใหญ่ พริกหวานทั้ง 3 สี ผัดพอเริ่มสุก', 3, '2021-09-15 12:20:06', '2021-09-15 12:20:06'),
(360, 110, 3, 'ปรุงรสด้วย น้ำพริกเผา ซอสหอยนางรม น้ำปลา น้ำตาลทราย เติมน้ำเปล่าผัดพอเข้ากันดี ใส่เนื้อปลานิลที่ทอดไว้ลงผัดเคล้าพอเข้ากันดี โรยต้นหอม ยกลงตักใส่จาน จัดเสิร์ฟ', 3, '2021-09-15 12:20:13', '2021-09-15 12:20:13'),
(361, 111, 1, 'ผสมแป้งทอดกรอบกับน้ำเย็นจัดคนให้เข้ากัน', 3, '2021-09-15 12:23:45', '2021-09-15 12:23:45'),
(362, 111, 2, 'นำปลาหมึกลงชุบแป้งที่เตรียมไว้จนทั่ว ใส่ลงทอดในน้ำมันพืชร้อนไฟปานกลางจนสุกเหลือง ตักขึ้นพักไว้', 3, '2021-09-15 12:23:50', '2021-09-15 12:23:50'),
(363, 111, 3, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่กระเทียมและน้ำพริกเผาลงผัดพอหอม ใส่หน่อไม้ฝรั่งลงผัดพอสุก', 3, '2021-09-15 12:23:55', '2021-09-15 12:23:55'),
(364, 111, 4, 'ปรุงรสด้วยซอสเห็ดหอม ซีอิ๊วขาว ซอสปรุงรส น้ำตาลทราย และน้ำเปล่าผัดพอเข้ากัน ใส่ปลาหมึกทอด ใบโหระพา และพริกชี้ฟ้าผัดให้เข้ากันอีกครั้ง', 3, '2021-09-15 12:24:01', '2021-09-15 12:24:01'),
(365, 111, 5, 'จัดข้าวสวยใส่ภาชนะ ราดด้วยปลาหมึกทอดผัดน้ำพริกเผา จัดเสิร์ฟ', 3, '2021-09-15 12:24:06', '2021-09-15 12:24:06'),
(366, 109, 1, 'คลุกเนื้อไก่กับแป้งสาลีจนทั่ว ปรุงรสด้วยเกลือป่น  เล็กน้อย พริกไทยป่น ตั้งกระทะใส่น้ำมันมะกอกประมาณ 3 ช้อนโต๊ะ ใส่ไก่ลงทอดพอสุก ตักไก่ออกพักไว้', 1, '2021-09-15 12:26:01', '2021-09-15 12:26:01'),
(367, 109, 2, 'นำกระทะใบเดิมใส่น้eมันมะกอกที่เหลือลงไป ใส่หอมหัวใหญ่ ต้นหอมญี่ปุ่น ก้านเซเลอรี่ กระเทียม แคร์รอต ผัดจนนิ่ม', 1, '2021-09-15 12:26:46', '2021-09-15 12:26:46'),
(368, 109, 3, 'ใส่เนื้อไก่ที่ทอดไว้ และทาร์รากอน เติมน้ำซุปไก่ ปรุงรส  ด้วย ซอสปรุงรส เกลือป่นและพริกไทยป่น เคี่ยวไฟอ่อน จนเดือด ใส่ข้าวสวย รอจนเดือดอีกครั้ง ปิดไฟใส่น้ำมะนาว คนให้เข้ากัน ตักใส่ภาชนะ จัดเสิร์ฟ', 1, '2021-09-15 12:26:55', '2021-09-15 12:26:55'),
(369, 112, 1, 'ตั้งกระทะใส่น้ำพริกแกงพะแนง กะทิลงผัดพอหอม ใส่น้ำเปล่าลงผัดพอเข้ากัน ปรุงรสด้วยน้ำปลา น้ำตาลปี๊บ ลงผัดให้เข้ากันอีกครั้ง ยกลงพักไว้ให้เย็น', 3, '2021-09-15 12:27:57', '2021-09-15 12:27:57'),
(370, 112, 2, 'ใส่อกไก่ คลุกเคล้ากับน้ำพริกแกง ใบมะกรูด พอเข้ากัน หมักทิ้งไว้ประมาณ 30 นาที', 3, '2021-09-15 12:28:01', '2021-09-15 12:28:01'),
(371, 112, 3, 'นำอกไก่เสียบไม้ปลายแหลมให้สวยงามจนครบ นำขึ้นย่างบนเตาไฟพอสุก ยกลง จัดเสิร์ฟ', 3, '2021-09-15 12:28:06', '2021-09-15 12:28:06'),
(372, 113, 1, 'นำปลาทับทิมคลุกแป้งทอดกรอบพอทั่ว นำลงทอดในน้ำมันพืชขณะร้อนพอสุกเหลือง ตักขึ้นพักไว้', 3, '2021-09-15 12:43:29', '2021-09-15 12:43:29'),
(373, 113, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่น้ำพริกแกงเผ็ดลงผัดพอหอม ใส่มะเขือเปราะลงผัดพอสุก ปรุงรสด้วยน้ำตาลทราย เติมน้ำเปล่าลงผัดพอเข้ากัน', 3, '2021-09-15 12:43:33', '2021-09-15 12:43:33'),
(374, 113, 3, 'ใส่กระชาย พริกไทยอ่อน ใบมะกรูด ใบกะเพรา พริกชี้ฟ้า ปลาทอด ลงผัดพอเข้ากันอีกครั้ง ตักใส่ภาชนะ จัดเสิร์ฟ', 3, '2021-09-15 12:43:38', '2021-09-15 12:43:38'),
