(651, 199, 1, 'ตั้งน้ำเปล่าให้เดือด ใส่ข่า ตะไคร้ ใบมะกรูด พอเดือดอีกครั้ง ใส่กุ้งกุลาดำ ปรุงรสด้วยน้ำปลา น้ำพริกเผา พอเดือดอีกครั้งปิดไฟ เติมน้ำมะนาว นมสด และพริกขี้หนู', 6, '2021-09-21 16:46:14', '2021-09-21 16:46:14'),
(652, 199, 2, 'จัดเส้นฟูซิลลีใส่ถ้วย ตักต้มยำกุ้งใส่ถ้วย ตกแต่งด้วยผักชี จัดเสิร์ฟ', 6, '2021-09-21 16:46:27', '2021-09-21 16:46:27'),
(653, 201, 1, 'ผสมซอสมะเขือเทศ น้ำตาลทราย พริกไทยดำป่น เกลือป่น น้ำส้มสายชู และน้ำมันพืช คนพอเข้ากัน', 3, '2021-09-22 09:42:58', '2021-09-22 09:42:58'),
(654, 201, 2, 'ใส่เนื้อหมู กระเทียม หอมหัวใหญ่ พริกหวาน และสับปะรด คลุกเคล้าพอเข้ากันพักไว้ประมาณ 15-20 นาที', 3, '2021-09-22 09:43:06', '2021-09-22 09:43:06'),
(655, 201, 3, 'นำเนื้อหมูที่หมักจนได้ที่ขึ้นย่างบนเตาไฟจนสุกทั้ง 2 ด้าน แล้วนำเครื่องที่หมักทั้งหมดใส่ภาชนะเติมน้ำซุป ตั้งไฟเคี่ยวจนเดือดมีลักษณะข้นเล็กน้อย ยกลงราดลงบนเนื้อหมูย่าง จัดเสิร์ฟ', 3, '2021-09-22 09:43:12', '2021-09-22 09:43:12'),
(656, 202, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่ปลาดุกลงทอดจนสุกเหลือง ตักขึ้นพักไว้', 3, '2021-09-22 09:45:53', '2021-09-22 09:45:53'),
(657, 202, 2, 'ตั้งกระทะใส่น้ำมันพืช ใส่น้ำพริกแกงเผ็ดลงผัดจนสุกหอม ปรุงรสด้วย น้ำตาลทราย และน้ำปลา เติมน้ำเปล่า ผัดให้เข้ากัน ใส่พริกชี้ฟ้าและใบมะกรูด ผัดให้เข้ากันอีกครั้งตักใส่จานโรยด้วย ใบกะเพราทอดกรอบ จัดเสิร์ฟ', 3, '2021-09-22 09:45:58', '2021-09-22 09:45:58'),
(658, 203, 1, 'หมักเนื้อไก่กับกระเทียมสับ ซอสเห็ดหอม ซอสปรุงรส น้ำปลา น้ำมันพืช น้ำตาลทราย พริกไทยดำป่น และเกลือป่นคลุกเคล้าให้เข้ากัน หมักทิ้งไว้ 30-45 นาที', 3, '2021-09-22 09:49:37', '2021-09-22 09:49:37'),
(659, 203, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน นำไก่ลงทอดจนสุกเหลือง ตักขึ้นพักไว้ให้สะเด็ดน้ำมัน', 3, '2021-09-22 09:49:41', '2021-09-22 09:49:41'),
(660, 203, 3, 'จัดข้าวสวยใส่ภาชนะ เรียงไก่ทอดด้านบน โรยกระเทียมเจียว ตกแต่งด้วยแตงกวา และผักชี จัดเสิร์ฟ', 3, '2021-09-22 09:49:47', '2021-09-22 09:49:47'),
(661, 204, 1, 'ตั้งกระทะใส่น้ำมันพืชกับกะปิผัดพอหอม', 3, '2021-09-22 09:52:17', '2021-09-22 09:52:17'),
(662, 204, 2, 'ใส่น้ำเปล่าลงผัด ตามด้วยปลาหมึกผัดจนสุก ใส่มะเขือเปราะ มะเขือพวง และหอมหัวใหญ่ผัดพอเข้ากัน', 3, '2021-09-22 09:52:25', '2021-09-22 09:52:25'),
(663, 204, 3, 'ใส่ข้าวสวยลงในกระทะผัดพอเข้ากัน ปรุงรสด้วยน้ำตาลทราย ใส่ใบมะกรูด พริกชี้ฟ้า และใบโหระพา ผัดพอสุก ตักใส่ภาชนะ จัดเสิร์ฟ', 3, '2021-09-22 09:52:32', '2021-09-22 09:52:32'),
(664, 205, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่สะโพกไก่ลงผัดจนสุกเหลือง จากนั้นเทน้ำมันออกให้เหลือประมาณ 1 ช้อนโต๊ะ', 3, '2021-09-22 09:56:22', '2021-09-22 09:56:22'),
(665, 205, 2, 'ใส่กระเทียม พริกสด ลงผัดพอหอม ปรุงรสด้วยน้ำปลา น้ำตาลทราย ซีอิ๊วขาว และซอสเห็ดหอม เติมน้ำเปล่าผัดพอเข้ากัน', 3, '2021-09-22 09:56:27', '2021-09-22 09:56:27'),
(666, 205, 3, 'ใส่ตะไคร้ ใบมะกรูด ข่า ผัดให้เข้ากันอีกครั้งตักใส่ภาชนะ จัดเสิร์ฟ', 3, '2021-09-22 09:56:34', '2021-09-22 09:56:34'),
(667, 206, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่กระเทียมลงผัดพอหอม', 3, '2021-09-22 10:05:04', '2021-09-22 10:05:04'),
(668, 206, 2, 'ใส่หอมหัวใหญ่ หมูกรอบ และเห็ดฟาง ปรุงรสด้วยน้ำพริกเผา น้ำตาลทราย น้ำปลา และซอสปรุงรส เติมน้ำเปล่าผัดให้เข้ากัน', 3, '2021-09-22 10:05:08', '2021-09-22 10:05:08'),
(669, 206, 3, 'ใส่ต้นหอมผัดให้เข้ากันอีกครั้ง จัดใส่ภาชนะเสิร์ฟพร้อมข้าวสวย', 3, '2021-09-22 10:05:13', '2021-09-22 10:05:13');
