(686, 211, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน นำปลาทับทิมคลุกแป้งทอดกรอบให้ทั่วเคาะแป้งส่วนเกินออก ใส่ลงทอดพอสุกเหลือง ตักขึ้นพักให้สะเด็ดน้ำมัน', 3, '2021-09-22 11:25:01', '2021-09-22 11:25:01'),
(687, 211, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่กระเทียม และพริกสดลงผัดพอหอม ปรุงรสด้วยน้ำปลา น้ำตาลทราย ซอสปรุงรส และซอสเห็ดหอม เติมน้ำเปล่าผัดพอเข้ากัน', 3, '2021-09-22 11:25:09', '2021-09-22 11:25:09'),
