(689, 212, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่น้ำพริกแกงเผ็ดลงผัดพอหอม ใส่หมูสามชั้นลงผัดพอสุก', 3, '2021-09-22 11:36:56', '2021-09-22 11:36:56'),
