(692, 213, 1, 'ผสมพริกขี้หนู กระเทียม น้ำตาลทราย น้ำมะนาว และน้ำปลา คนพอเข้ากันพักไว้', 3, '2021-09-22 11:40:02', '2021-09-22 11:40:02'),
(693, 213, 2, 'ต้มน้ำเปล่าพอเดือด นำหมูลงลวกจนสุก ตักขึ้นพักไว้ให้สะเด็ดน้ำ จากนั้นนำก๋วยเตี๋ยวเส้นใหญ่ลงลวกพอสุก ตักขึ้นพักไว้ให้สะเด็ดน้ำ คลุกเคล้ากับน้ำมันกระเทียมเจียวจนทั่ว เพื่อไม่ให้เส้นติดกัน', 3, '2021-09-22 11:40:07', '2021-09-22 11:40:07'),
(694, 213, 3, 'จัดก๋วยเตี๋ยวเส้นใหญ่ ผักคะน้า หมูลวก ใส่ภาชนะ ราดด้วยน้ำยำที่ผสมไว้ในส่วนผสมข้อที่ 1 จัดเสิร์ฟ', 3, '2021-09-22 11:40:13', '2021-09-22 11:40:13'),
(695, 214, 1, 'ผสมน้ำมะนาว น้ำปลา น้ำตาลปี๊บ และพริกป่น คนให้เข้ากัน', 3, '2021-09-22 11:42:43', '2021-09-22 11:42:43'),
(696, 214, 2, 'ใส่เนื้อปลาดุก ผักชีฝรั่ง ต้นหอม หอมแดง ตะไคร้ และถั่วลิสงคั่ว คลุกเคล้าพอเข้ากัน  ตักใส่ภาชนะ โรยหน้าด้วยใบมะกรูด จัดเสิร์ฟ', 3, '2021-09-22 11:42:48', '2021-09-22 11:42:48'),
(697, 215, 1, 'โขลกกระเทียมกับพริกสดพอละเอียด ตักขึ้นพักไว้', 3, '2021-09-22 11:47:00', '2021-09-22 11:47:00'),
(698, 215, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่เครื่องที่โขลกลงไว้ผัดพอหอม ใส่หมูสับลงผัดพอสุก', 3, '2021-09-22 11:47:04', '2021-09-22 11:47:04'),
(699, 215, 3, 'ปรุงรสด้วยซอสเห็ดหอม ซีอิ๊วขาว น้ำปลา ซอสปรุงรส น้ำตาลทราย เติมน้ำเปล่าผัดพอเข้ากัน ใส่กระชาย ใบโหระพา ผัดให้เข้ากันอีกครั้ง ตักใส่ภาชนะ โรยด้วยใบโหระพาทอดกรอบ จัดเสิร์ฟ', 3, '2021-09-22 11:47:13', '2021-09-22 11:47:13'),
(700, 216, 1, 'ต้มน้ำเปล่าพอเดือด ใส่หมูสามชั้นลงต้มพอสุก ตักขึ้นใช้ส้อมจิ้มหนังจนทั่ว นำไปใส่ตะแกรงผึ่งลมพอแห้งพักไว้', 3, '2021-09-22 11:49:54', '2021-09-22 11:49:54'),
(701, 216, 2, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่หมูสามชั้นในข้อที่ 1 ลงทอดพอเหลืองกรอบ ตักขึ้นหั่นเป็นชิ้นพักไว้', 3, '2021-09-22 11:49:59', '2021-09-22 11:49:59'),
(702, 216, 3, 'ใส่หมูกรอบ ตะไคร้ หอมแดง กระเทียม พริกขี้หนู น้ำมะนาว น้ำปลา น้ำตาลทราย คนให้เข้ากัน ใส่ผักชีคนให้เข้ากันอีกครั้ง ตักใส่ภาชนะ โรยด้วยพริกขี้หนูแห้งทอด ใบมะกรูดทอด จัดเสิร์ฟ', 3, '2021-09-22 11:50:04', '2021-09-22 11:50:04'),
