(980, 308, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน นำน้ำพริกแกงเผ็ดลงผัดจนสุกหอม', 3, '2021-09-22 18:25:18', '2021-09-22 18:25:18'),
