(985, 310, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่น้ำพริกแกงเผ็ดลงผัดพอหอม ใส่หัวกะทิผัดจนแตกมัน ใส่เนื้อหมูลงผัดพอสุก', 3, '2021-09-22 18:30:15', '2021-09-22 18:30:15'),
