(992, 312, 2, 'ผสมเครื่องที่โขลกกับเนื้อปลาดุก และน้ำปลา คลุกเคล้าพอเข้ากัน พักไว้ประมาณ 15 นาที', 3, '2021-09-22 18:35:30', '2021-09-22 18:35:30'),
