(997, 313, 1, 'โรยพริกไทยดำบด ยี่หร่า และลูกผักชี ให้ทั่วชิ้นเนื้อ ราดน้ำมันมะกอก และซอสหอยนางรม ใส่ผักชี กระเทียม รากผักชี คลุกเคล้าให้เข้ากัน หมักไว้ประมาณ 10 นาที', 6, '2021-09-23 15:19:39', '2021-09-23 15:19:39'),
