(1000, 314, 1, 'ตั้งกระทะใส่น้ำมันถั่วเหลือง พอร้อนใส่ข้าวเกรียบ ผักลงทอดจนฟูกรอบ เหลือง ตักขึ้น พักให้สะเด็ดน้ำมัน', 6, '2021-09-23 15:28:07', '2021-09-23 15:28:07'),
