(1015, 319, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่น้ำพริกแกงเผ็ดลงผัด ค่อยๆ ใส่หัวกะทิผัดจนน้ำพริกสุกหอม ตักใส่หม้อ เติมหางกะทิคนให้ละลายเป็นเนื้อเดียวกัน', 6, '2021-09-24 07:27:07', '2021-09-24 07:27:07'),
