(1019, 320, 2, 'เติมน้ำซุปไก่คนให้เข้ากันพอเดือด ใส่ไก่ หอมหัวใหญ่ มันฝรั่ง แคร์รอต มะเขือเทศ พริกหวาน และใบกระวาน เคี่ยวประมาณ 45 นาที จนไก่สุกนุ่มและน้ำมีลักษณะเหนียวข้นตักใส่ภาชนะ จัดเสิร์ฟ', 6, '2021-09-24 07:40:20', '2021-09-24 07:40:20'),
