(1079, 340, 4, 'นำกระทะเทฟลอนตั้งไฟ ใส่เนยสดพอร้อนจนละลาย ใส่ไข่ไก่ รอจนไข่เริ่มเซ็ตตัว', 6, '2021-09-26 05:42:31', '2021-09-26 05:42:31'),
(1080, 340, 5, 'ใส่ส่วนผสมข้อที่ 2 โรยพาร์มีซานชีส และใบสะระแหน่เล็กน้อย แล้วค่อยๆ ม้วนไข่เป็นท่อนยาว ตักใส่จาน โรยพาร์มีซานชีส และใบสะระแหน่ที่เหลือจัดเสิร์ฟ', 6, '2021-09-26 05:42:45', '2021-09-26 05:42:45'),
(1081, 341, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน นำน้ำพริกแกงเผ็ดลงผัดพอหอม', 6, '2021-09-26 06:15:54', '2021-09-26 06:15:54'),
(1082, 341, 2, 'ใส่กุ้งสด ผัดพอสุก เติมน้ำเปล่า ปรุงรสด้วย น้ำตาลทราย น้ำปลา ผัดพอเข้ากัน', 6, '2021-09-26 06:16:05', '2021-09-26 06:16:05'),
(1083, 341, 3, 'โรยใบมะกรูดฉีก พริกชี้ฟ้า และใบโหระพา ผัดให้เข้ากันอีกครั้ง ตักราดบนเส้นสปาเกตตีที่จัดใส่ภาชนะไว้ จัดเสิร์ฟ', 6, '2021-09-26 06:16:15', '2021-09-26 06:16:15'),
(1084, 342, 1, 'ผสมน้ำปลา น้ำมะนาว น้ำตาลปี๊บ พริกขี้หนูบุบและหอมแดงซอยให้เข้ากัน ชิมรสตามชอบ', 6, '2021-09-26 06:27:11', '2021-09-26 06:27:11'),
(1085, 342, 2, 'ใส่เนื้อหมู กุ้งและปลาหมึกที่เตรียมไว้ลงไปคลุกเคล้าให้เข้ากันกับมะระหวานและแคร์รอต ตักใส่จานที่เตรียมไว้ โรยด้วยผักชี', 6, '2021-09-26 06:27:20', '2021-09-26 06:27:20'),
(1086, 343, 1, 'โรยเกลือป่นกับพริกไทยป่น ลงบนเนื้อปลากะพง พอทั่ว', 6, '2021-09-26 06:32:52', '2021-09-26 06:32:52'),
(1087, 343, 2, 'ตั้งกระทะเทฟลอนใส่น้ำมันพืชพอร้อน นำเนื้อปลากะพงลงย่างจนสุกเหลืองทั้ง 2 ด้าน ตักขึ้นพักไว้', 6, '2021-09-26 06:33:03', '2021-09-26 06:33:03'),
(1088, 343, 3, 'ผสมน้ำมะนาว น้ำปลา น้ำตาลทราย คนพอเข้า กัน ใส่ขิง กุ้งแห้ง หอมแดง ต้นหอม ผักชี คลุกเคล้าเบา ๆ พอเข้ากัน', 6, '2021-09-26 06:33:13', '2021-09-26 06:33:13'),
(1089, 343, 4, 'วางเนื้อปลากะพงย่างลงในภาชนะ ราดส่วนผสมในข้อที่ 3 จัดเสิร์ฟ', 6, '2021-09-26 06:33:23', '2021-09-26 06:33:23'),
(1090, 344, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่หมูสามชั้นลงผัดพอเหลืองตักขึ้น', 6, '2021-09-26 06:48:48', '2021-09-26 06:48:48'),
(1091, 344, 2, 'เบาไฟใส่น้ำพริกผัดพริกขิงลงผัดจนหอม ใส่กุ้งแห้งป่นผัดให้เข้ากัน ปรุงรสด้วยน้ำตาลปี๊บ น้ำปลา ถ้าแห้งเติมน้ำซุปเล็กน้อย', 6, '2021-09-26 06:49:01', '2021-09-26 06:49:01'),
(1092, 344, 3, 'ใส่หมูสามชั้นในข้อที่ 1 และถั่วฝักยาวเร่งไฟแรงผัดพอสุก ใส่พริกชี้ฟ้า ใบมะกรูดผัดให้เข้ากัน จัดเสิร์ฟร้อน ๆ', 6, '2021-09-26 06:49:12', '2021-09-26 06:49:12'),
(1093, 345, 1, 'แช่โปรตีนเกษตรในน้ำเปล่าจนนุ่ม บีบน้ำออก ล้างหลาย ๆ ครั้งจนหมดกลิ่นอับ บีบให้แห้ง', 6, '2021-09-26 06:59:55', '2021-09-26 06:59:55'),
(1094, 345, 2, 'ใส่โปรตีนเกษตรลงในภาชนะ โรยพริกไทยป่นให้ทั่ว ใส่ขิงสับ ปรุงรสด้วยซอสเห็ดหอม ซีอิ๊วขาว น้ำตาลทราย ใส่แป้งข้าวโพดคลุกเคล้าให้เข้ากัน หมักไว้ 20 นาที', 6, '2021-09-26 07:00:03', '2021-09-26 07:00:03'),
(1095, 345, 3, 'ตั้งกระทะใส่น้ำมันพืช พอร้อนใส่เห็ดหอมลงผัดพอหอม ใส่โปรตีนเกษตรที่หมักไว้ ผัดพอทั่ว เติมน้ำเปล่า ใส่ถั่วขาว เบาไฟ เคี่ยวไฟอ่อน ตักใส่ภาชนะ แต่งด้วยขึ้นฉ่าย จัดเสิร์ฟ', 6, '2021-09-26 07:00:15', '2021-09-26 07:00:15'),
(1096, 346, 1, 'ตั้งกระทะใช้ไฟอ่อน เทมิโซะและมิรินเทลงไปกวนผสมจนเข้ากัน ใส่ไข่แดงลงไปคนจนเป็นเนื้อเดียวกัน พักไว้', 6, '2021-09-26 07:07:29', '2021-09-26 07:07:29'),
(1097, 346, 2, 'ตั้งไฟสำหรับย่าง ทาน้ำมันพืชให้ทั่วตะแกรง ทาส่วนผสมซอสให้ทั่วเนื้อปลากะพง นำไปย่างด้วยไฟอ่อนจนสุก จัดเสิร์ฟพร้อมกับหัวไชเท้าขูด และข้าวสวยญี่ปุ่น', 6, '2021-09-26 07:07:38', '2021-09-26 07:07:38'),
(1098, 347, 1, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่กระเทียมสับผัดพอเหลืองหอม ใส่สันนอกหมูสไลซ์ หอมหัวใหญ่ และพริกหวานผัดพอสุก', 6, '2021-09-26 07:45:51', '2021-09-26 07:45:51'),
(1099, 347, 2, 'ปรุงรสด้วยซอสหอยนางรม ซอสปรุงรส น้ำตาลทราย และพริกไทยดำ เติมน้ำเปล่า ผัดให้เข้ากัน', 6, '2021-09-26 07:46:03', '2021-09-26 07:46:03'),
(1100, 347, 3, 'โรยด้วยต้นหอม ตักเสิร์ฟพร้อมข้าวสวย', 6, '2021-09-26 07:46:16', '2021-09-26 07:46:16'),
(1101, 348, 1, 'โขลกรากผักชี กระเทียม พริกไทยให้ละเอียด', 6, '2021-09-26 07:55:46', '2021-09-26 07:55:46'),
(1102, 348, 2, 'นำเต้าหู้ไข่คลุกแป้งสาลี ใส่ลงทอดในน้ำมันพืชร้อนไฟปานกลางจนเหลืองสวยทั้ง 2 ด้าน ตักขึ้นพักไว้ให้สะเด็ดน้ำมัน และใส่เต้าหู้ขาว ลงทอดสุกเหลืองทั้ง 2 ด้าน ตักขึ้นพักไว้ให้สะเด็ดน้ำมัน จัดใส่จานเตรียมไว้', 6, '2021-09-26 07:55:54', '2021-09-26 07:55:54'),
(1103, 348, 3, 'ตั้งกระทะใส่น้ำมันพืชพอร้อน ใส่เครื่องที่โขลกไว้ลงผัดพอหอม ปรุงรสด้วยน้ำตาลปี๊บ ซีอิ๊วขาว น้ำส้มสายชู เคี่ยวพอเข้ากัน ปิดไฟ', 6, '2021-09-26 07:56:01', '2021-09-26 07:56:01'),
(1104, 348, 4, 'ตักส่วนผสมในข้อที่ 3 ราดบนเต้าหู้ที่ทอดไว้ โรยด้วยผักชี พริกขี้หนูแห้งทอด จัดเสิร์ฟ', 6, '2021-09-26 07:56:10', '2021-09-26 07:56:10'),
(1105, 349, 1, 'ล้างซี่โครงหมูให้สะอาด หั่นชิ้นเตรียมไว้', 6, '2021-09-26 08:02:52', '2021-09-26 08:02:52'),
(1106, 349, 2, 'โขลกรากผักชี กระเทียม พริกไทยให้ละเอียด ใส่ลงในซี่โครงหมู ปรุงรสด้วยซอสเห็ดหอม ซอสปรุงรส น้ำตาลทราย น้ำผึ้ง คลุกเคล้าให้เข้ากันหมักไว้ 1-3 ชั่วโมง', 6, '2021-09-26 08:03:26', '2021-09-26 08:03:26'),
(1107, 349, 3, 'นำน้ำเปล่าใส่หม้อยกขึ้นตั้งไฟพอเดือด ใส่ซี่โครงหมูที่หมักไว้เดือดอีกครั้งเบาไฟ เคี่ยวจนกระดูก หมูสุกนุ่ม เพิ่มเป็นไฟแรงเพื่อให้น้ำงวด ตักใส่ภาชนะ ตกแต่งด้วยผักชี จัดเสิร์ฟ', 6, '2021-09-26 08:03:40', '2021-09-26 08:03:40'),
(1108, 350, 1, 'ตั้งกระทะไฟปานกลางใส่น้ำมันพืช พอร้อน นำน้ำพริกแกงพะแนงลงผัดพอหอมเติมกะทิเล็กน้อยผัดพอแตกมัน', 6, '2021-09-26 08:19:17', '2021-10-10 23:40:40'),
(1109, 350, 2, 'ใส่ปลาหมึก ลงผัดพอสุก เติมกะทิที่เหลือ รอให้เดือด', 6, '2021-09-26 08:19:28', '2021-09-26 08:19:28'),
(1110, 350, 3, 'ปรุงรสด้วย น้ำตาลปี๊บ น้ำปลา คนให้เข้ากัน เคี่ยวต่อสักครู่พอมีลักษณะข้นเล็กน้อย', 6, '2021-09-26 08:19:37', '2021-09-26 08:19:37'),
(1111, 350, 4, 'ใส่พริกชี้ฟ้า ใบโหระพา คนพอเข้ากัน ยกลง ตักราดลงบนเส้นสปาเกตตี จัดเสิร์ฟ', 6, '2021-09-26 08:19:47', '2021-09-26 08:19:47');
